import React from "react";


const Favourite=()=>{
    return(
        <h1>My favourite colour is black</h1>
    );
};


const name1 = "Khanam";
const subject = "Reactjs";

const myFunction = (data1,data2) => {
  let completeData=`My data 1 is ${data1} and my data 2 is ${data2}`;
  return completeData;
};


export default Favourite;
export {name1,subject};
